CREATE VIEW _timescaledb_internal._direct_view_7 AS
 SELECT public.time_bucket('1 day'::interval, historical_data.ts) AS bucket,
    avg(historical_data.temperature) AS avg_temp,
    max(historical_data.temperature) AS max_temp,
    min(historical_data.temperature) AS min_temp
   FROM public.historical_data
  GROUP BY (public.time_bucket('1 day'::interval, historical_data.ts));


