    pin smallint NOT NULL,
    ts timestamp without time zone NOT NULL,
    stringvalue text,
    doublevalue double precision
);


ALTER TABLE public.status_data OWNER TO sbrubbles;

--
-- TOC entry 1198 (class 1259 OID 98268)
-- Name: temperature_summary_daily; Type: VIEW; Schema: public; Owner: moclad
--

CREATE VIEW public.temperature_summary_daily AS
 SELECT _materialized_hypertable_7.bucket,
    _materialized_hypertable_7.avg_temp,
    _materialized_hypertable_7.max_temp,
    _materialized_hypertable_7.min_temp
   FROM _timescaledb_internal._materialized_hypertable_7
  WHERE (_materialized_hypertable_7.bucket < COALESCE(_timescaledb_internal.to_timestamp_without_timezone(_timescaledb_internal.cagg_watermark(7)), '-infinity'::timestamp without time zone))
UNION ALL
 SELECT public.time_bucket('1 day'::interval, historical_data.ts) AS bucket,
    avg(historical_data.temperature) AS avg_temp,
    max(historical_data.temperature) AS max_temp,
    min(historical_data.temperature) AS min_temp
   FROM public.historical_data
  WHERE (historical_data.ts >= COALESCE(_timescaledb_internal.to_timestamp_without_timezone(_timescaledb_internal.cagg_watermark(7)), '-infinity'::timestamp without time zone))
  GROUP BY (public.time_bucket('1 day'::interval, historical_data.ts));


ALTER TABLE public.temperature_summary_daily OWNER TO moclad;

